## DETimeVg2 labels - English

## DETimeVg2
DETimeVg2 = Vg / Time (age) or Hdom
DETimeVg2.xLabelDate = Time or Age
DETimeVg2.xLabelCdom = Cdom (cm)
DETimeVg2.yLabel = Vg (m3)

showIncrement = show increment instead of value
xIsCdom = Cdom on X-axis

DETimeVg2.description = Evolution of Vg along time (or stand age) or Cdom

